import React, { useEffect, useState } from "react";
import "../request/Request.scss";

const Request = () => {
  const [currentStep, setCurrentStep] = useState(0);
  const steps = [
    { title: "Fish Details", subtitle: "Enter information about Fish" },
    { title: "Auction Method", subtitle: "Choose the auction method" },
    { title: "Auction Detail", subtitle: "Provide auction details" },
    { title: "Preview", subtitle: "Preview your request" },
  ];
  const methodDexcription = [
    { title: "Fixed Price", subtitle: "Buyer pays a fixed price" },
    { title: "Hidden Auction", subtitle: "Buyer pays the hidden price" },
    { title: "Public Auction", subtitle: "Buyer pays the highest price" },
    {
      title: "Descending price auction",
      subtitle: "Buyer pays the price",
    },
  ];

  const [name, setName] = useState("");
  const [shape, setShape] = useState("");
  const [age, setAge] = useState(0);
  const [weight, setWeight] = useState(0);
  const [fondAddress, setFondAddress] = useState("");
  const [city, setCity] = useState("");
  const [gender, setGender] = useState(0);
  const [image, setImage] = useState([]);
  const [auctionMethod, setAuctionMethod] = useState(1);
  const [date, setDate] = useState("");
  const [startPrice, setStartPrice] = useState(0);
  const [maxPrice, setMaxPrice] = useState(0);
  const [stepPrice, setStepPrice] = useState(0);

  const filedsets = [
    {
      title: "Fish Details",
      content: (
        <fieldset>
          {/* name+shape */}
          <div className="fieldInput">
            <div className="col-md-6 inputBox">
              <h5>Fish Name</h5>
              <input
                type="text"
                name="fishName"
                placeholder="Fish Name"
                onChange={(e) => setName(e.target.value)}
              />
            </div>
            <div className="col-md-6 inputBox">
              <h5>Fish Shape</h5>
              <input
                type="text"
                name="FishShape"
                placeholder="Fish Shape"
                onChange={(e) => setShape(e.target.value)}
              />
            </div>
          </div>
          {/* age+weight */}
          <div className="fieldInput">
            <div className="col-md-6 inputBox">
              <h5>Fish Age</h5>
              <input
                type="text"
                name="FishAge"
                placeholder="Fish Age"
                onChange={(e) => setAge(e.target.value)}
              />
            </div>
            <div className="col-md-6 inputBox">
              <h5>Fish Weight</h5>
              <input
                type="text"
                name="FishWeight"
                placeholder="Fish Weight"
                onChange={(e) => setWeight(e.target.value)}
              />
            </div>
          </div>
          {/* FondAddress+City */}
          <div className="fieldInput">
            <div className="col-md-6 inputBox">
              <h5>Fond Address</h5>
              <input
                type="text"
                name="FondArrdess"
                placeholder="Fond Arrdess"
                onChange={(e) => setFondAddress(e.target.value)}
              />
            </div>
            <div className="col-md-6 inputBox">
              <h5>Fish City</h5>
              <input
                type="text"
                name="FishCity"
                placeholder="Fish City"
                onChange={(e) => setCity(e.target.value)}
              />
            </div>
          </div>
          {/* gender */}
          <div className="fieldInput">
            <div className="col-md-6 gender-group">
              <div className="gender">Gender:</div>
              <div className="gender-select">
                <input
                  type="radio"
                  name="gender"
                  value="female"
                  className="gender-option"
                  onClick={() => setGender(2)}
                />
                <div>Female</div>
              </div>
              <div className="gender-select">
                <input
                  type="radio"
                  name="gender"
                  value="male"
                  className="gender-option"
                  onClick={() => setGender(1)}
                />
                <div>Male</div>
              </div>
            </div>
            <div className="col-md-6"></div>
          </div>
          {/* img */}
          <div className="fieldInput">
            <div className="imgInput">
              <div className="plus-icon"></div>
            </div>
            <div className="imgInput">
              <div className="plus-icon"></div>
            </div>
            <div className="imgInput">
              <div className="plus-icon"></div>
            </div>
            <div className="imgInput">
              <div className="plus-icon"></div>
            </div>
          </div>
        </fieldset>
      ),
    },
    {
      title: "Auction Method",
      content: (
        <fieldset>
          <div className="fieldInput">
            <select
              name="auctionMethod"
              className="auctionMethod"
              onChange={(e) => setAuctionMethod(e.target.value)}
            >
              <option value="1">Fixed Price</option>
              <option value="2">Hidden Auction</option>
              <option value="3">Public Auction</option>
              <option value="4">Descending Auction</option>
            </select>
          </div>
          <div>
            {methodDexcription.map((item, index) => (
              <h4
                key={index}
                style={{
                  display: index === auctionMethod - 1 ? "block" : "none",
                }}
              >
                {" "}
                {item.subtitle}{" "}
              </h4>
            ))}
          </div>
        </fieldset>
      ),
    },
    {
      title: "Auction Detail",
      content: (
        <fieldset>
          <div className="fieldInput">
            <div className="inputBox">
              <h5>Auction Date</h5>
              <input
                type="date"
                name="autionDate"
                onChange={(e) => setDate(e.target.value)}
              />
            </div>
          </div>
          <div className="fieldInput">
            <div className="inputBox">
              <h5>{auctionMethod === "1" ? "Fixed Price" : "Min Price"}</h5>
              <div className="price">
                <input type="text" name="auctionPrice" placeholder="XXXXXXX" />
                <span className="dollar-sign">$</span>
              </div>
            </div>
          </div>
          <div
            className="fieldInput"
            style={{
              display:
                auctionMethod === "3" || auctionMethod === "4" ? "" : "none",
            }}
          >
            <div className="inputBox">
              <h5>Max Price</h5>
              <div className="price">
                <input
                  type="text"
                  name="auctionPrice"
                  placeholder="XXXXXXX"
                  onChange={(e) => setMaxPrice(e.target.value)}
                />
                <span className="dollar-sign">$</span>
              </div>
            </div>
          </div>
          <div
            className="fieldInput"
            style={{ display: auctionMethod === "3" ? "" : "none" }}
          >
            <div className="inputBox">
              <h5>Increment Step</h5>
              <div className="price">
                <input
                  type="text"
                  name="incrementStep"
                  placeholder="XXXXXXX"
                  onChange={(e) => setStepPrice(e.target.value)}
                />
                <span className="dollar-sign">$</span>
              </div>
            </div>
          </div>
        </fieldset>
      ),
    },
    {
      title: "Preview",
      content: (
        <fieldset>
          {/* name+shape */}
          <div className="fieldInput">
            <div className="col-md-6 inputBox">
              <h5>Fish Name</h5>
              <input
                type="text"
                name="fishName"
                value={name}
                disabled="true"
                onChange={(e) => setName(e.target.value)}
              />
            </div>
            <div className="col-md-6 inputBox">
              <h5>Fish Shape</h5>
              <input
                type="text"
                name="FishShape"
                value={shape}
                disabled="true"
                onChange={(e) => setShape(e.target.value)}
              />
            </div>
          </div>
          {/* age+weight */}
          <div className="fieldInput">
            <div className="col-md-6 inputBox">
              <h5>Fish Age</h5>
              <input
                type="text"
                name="FishAge"
                disabled="true"
                value={age}
                onChange={(e) => setAge(e.target.value)}
              />
            </div>
            <div className="col-md-6 inputBox">
              <h5>Fish Weight</h5>
              <input
                type="text"
                name="FishWeight"
                disabled="true"
                value={weight}
                onChange={(e) => setWeight(e.target.value)}
              />
            </div>
          </div>
          {/* FondAddress+City */}
          <div className="fieldInput">
            <div className="col-md-6 inputBox">
              <h5>Fond Address</h5>
              <input
                type="text"
                name="FondArrdess"
                value={fondAddress}
                disabled="true"
                onChange={(e) => setFondAddress(e.target.value)}
              />
            </div>
            <div className="col-md-6 inputBox">
              <h5>Fish City</h5>
              <input
                type="text"
                name="FishCity"
                value={city}
                disabled="true"
                onChange={(e) => setCity(e.target.value)}
              />
            </div>
          </div>
          {/* gender */}
          <div className="fieldInput">
            <div className="col-md-6 gender-group">
              <div className="gender">Gender:</div>
              <div className="gender-select">
                <input
                  type="radio"
                  name="gender"
                  checked={gender === 2}
                  disabled="true"
                  className="gender-option"
                />
                <div>Female</div>
              </div>
              <div className="gender-select">
                <input
                  type="radio"
                  name="gender"
                  checked={gender === 1}
                  disabled="true"
                  className="gender-option"
                />
                <div>Male</div>
              </div>
            </div>
            <div className="col-md-6"></div>
          </div>
          {/* img */}
          <div className="fieldInput" aria-disabled="true">
            <div className="imgInput">
              <div className="plus-icon"></div>
            </div>
            <div className="imgInput">
              <div className="plus-icon"></div>
            </div>
            <div className="imgInput">
              <div className="plus-icon"></div>
            </div>
            <div className="imgInput">
              <div className="plus-icon"></div>
            </div>
          </div>
          {/* method */}
          {methodDexcription.map((item, index) => (
            <h3
              key={index}
              style={{
                display: index === auctionMethod - 1 ? "block" : "none",
              }}
            >
              {"Auction Method: "}
              {item.title}{" "}
            </h3>
          ))}
        </fieldset>
      ),
    },
  ];
  const handleNext = () => {
    if (currentStep < steps.length - 1) {
      setCurrentStep(currentStep + 1);
    }
  };

  const handlePrevious = () => {
    if (currentStep > 0) {
      setCurrentStep(currentStep - 1);
    }
  };
  useEffect(() => {
    console.log(auctionMethod);
  }, [auctionMethod]);
  return (
    <div className="request-form">
      <div className="header"></div>

      <div className="row">
        <div className="col-md-6 col-md-offset-3">
          <form className="request">
            <ul className="progressbar">
              {steps.map((step, index) => (
                <li
                  key={index}
                  className={index <= currentStep ? "active" : ""}
                >
                  {step.title}
                </li>
              ))}
            </ul>

            {steps.map((step, index) => (
              <fieldset
                key={index}
                style={{ display: index === currentStep ? "block" : "none" }}
              >
                <h2 className="fs-title">{step.title}</h2>
                <h3 className="fs-subtitle">{step.subtitle}</h3>

                {/* Example field input */}
                {filedsets[index]?.content}

                <div className="action-buttons">
                  {index > 0 && (
                    <button
                      type="button"
                      className="previous action-button-previous"
                      onClick={handlePrevious}
                    >
                      Previous
                    </button>
                  )}
                  {index < steps.length - 1 ? (
                    <button
                      type="button"
                      className="next action-button"
                      onClick={handleNext}
                    >
                      Next
                    </button>
                  ) : (
                    <button
                      type="submit"
                      name="submit"
                      className="submit action-button"
                    >
                      Submit
                    </button>
                  )}
                </div>
              </fieldset>
            ))}
          </form>
        </div>
      </div>
    </div>
  );
};

export default Request;
